import React from 'react';
import { 
    Card,
    CardHeader,
    CardContent,
    Typography,
    Avatar
 } from '@material-ui/core';

import './InfoCard.scss';

const InfoCard = (props) => {
    return (
        <Card className="info-card_container">
            <CardHeader 
                avatar={<Avatar>{props.cardIcon}</Avatar>}
                title={props.title}
            />
            <CardContent>
                <Typography 
                 variant="body2"
                 color="textSecondary" 
                 component="p">
                    {props.description}
                </Typography>
            </CardContent>
        </Card>
    );
}

export default InfoCard;
